import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import ServiceOne from "./Services_app.js"
import ServiceTwo from "./replica.js"
function App() {
  return (
    <div className="App">
      <Router>
        <Navigation />
        <Switch>
          <Route path="./Services_app.js" exact component={() => <About />} />
          <Route path="./replica.js" exact component={() => <Contact />} />
        </Switch>
        <Footer />
      </Router>
    </div>
  );
}

export default App;
